SET FOREIGN_KEY_CHECKS = 0;
DROP table if EXISTS vitals.chamber_data;
CREATE TABLE chamber_data (
	chmb_id varchar(10) NOT NULL,
	temp float NOT NULL,
	ph float NOT NULL,
	ADCRaw float NOT NULL,
	ADCVolt float NOT NULL,
	DOX float NOT NULL,
	sub_date timestamp NOT NULL,
	primary key (`chmb_id`, `sub_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

DROP table if EXISTS vitals.organizations;
CREATE TABLE organizations (
	id varchar(10) NOT NULL,
    valid bool default 0,
    primary key(id)
);

DROP table if EXISTS vitals.users;
CREATE TABLE users (
	email varchar(40) NOT NULL,
    password varchar(20) NOT NULL,
    org_id varchar(10) NOT NULL,
    authenticated bool default 0,
    primary key(email),
    foreign key(org_id) references organizations(id) 
		on delete cascade
);

DROP table if EXISTS vitals.org2chambers;
CREATE TABLE org2chambers (
	org_id varchar(10) NOT NULL,
    chmb_id varchar(10) NOT NULL,
    foreign key(org_id) references organizations(id)
		on delete cascade,
    foreign key (chmb_id) references chamber_data(chmb_id)
		on delete cascade
);

DROP table if EXISTS vitals.users2chambers;
CREATE TABLE users2chambers (
	user_email varchar(40) NOT NULL,
    chmb_id varchar(10) NOT NULL,
    foreign key (chmb_id) references chamber_data(chmb_id)
		on delete cascade,
	foreign key (user_email) references users(email)
		on delete cascade
);
SET FOREIGN_KEY_CHECKS = 1;




